import React, { Component } from "react";
import Layout from "../../components/Layout";

class CampaignNew extends Component {
  render() {
    return (
      <Layout>
        <h3>New Campaign!</h3>

        <Form>
          <Form.Field>
            <label>Minimum Contribution</label>
            <input />
          </Form.Field>

          <Button primary>Create!</Button>
        </Form>
      </Layout>
    );
  }
}

export default CampaignNew;
